是否启用自动布局适配RTL，启用后自动将Left|Right转换为Leading|Trailing，默认NO
- note: 如果项目兼容阿拉伯语等，需要启用RTL从右向左布局，开启此开关即可，无需修改布局代码
手工切换视图左右布局方法：[UIView appearance].semanticContentAttribute = UISemanticContentAttributeForceRightToLeft;

